import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import { Container, Row, Col } from 'reactstrap';


const useStyles = makeStyles((theme) => ({
    skillTitle: {

      fontSize:"26px",
      padding:"2rem",
      textAlign:"center",
      color:"white",
    },
    background:{
        backgroundColor:"#233",
    },
    AllTextCenter:{
        textAlign:"center",

    },
    flexAligh:{
        color:"white",
        display:"flex",
        flexDirection:"row",
    },
    skillItems:{
        borderBottom:"1px solid white",
        marginBottom:"50px",
        paddingBottom:"50px",
    },

  }));


const Skills = () => {

const classes = useStyles();

    return (
        <Container className={classes.background}>
                <Row className={classes.skillTitle}><h2>My Skills</h2></Row>
           <Row class={classes.AllTextCenter}>

                <Row className={classes.flexAligh}>
                    <Col className={classes.skillItems}>
                      <h3>HTML5 / CSS3</h3>
                      <div class="skill-bar">
                            <span>95%</span>
                            <div class="filled-bar"></div>
                     </div>   
                    </Col>
                    <Col className={classes.skillItems}>
                      <h3>Bootstrap</h3>

                    </Col>
                </Row>      

           </Row>   
        </Container>                        

    );
  };
  export default Skills;
